import React from 'react';
import { Link, useNavigate } from 'react-router-dom';
import './Welcome.css';

const Welcome = () => {
  const navigate = useNavigate();

  const goToPosts = () => {
    navigate('/posts');
  };

  return (
    <div className="welcome-container dark-theme">
      <div className="welcome-card animate-in">
        <h1 className="welcome-title">Welcome to Info Hub</h1>
        <p className="welcome-subtitle">Your gateway to sharing and discovering campus events.</p>

        <div className="welcome-buttons">
          <Link to="/registration" className="welcome-button register-button">Register</Link>
          <Link to="/login" className="welcome-button login-button">Login</Link>
        </div>

        <button className="cta-button" onClick={goToPosts}>
          Want to know events happening?
        </button>

        <footer className="welcome-footer">
          <p>&copy; 2024 Info Hub. All rights reserved.</p>
        </footer>
      </div>
    </div>
  );
};

export default Welcome;
